import React, { useState } from 'react';
import { ChevronLeftIcon, ChevronRightIcon } from '@heroicons/react/24/solid';

// Import watch images
import watch1 from '../assets/watch_banner_1_1764666960565.png';
import watch2 from '../assets/watch_banner_2_1764666980783.png';
import watch3 from '../assets/watch_banner_3_1764666995991.png';
import watch4 from '../assets/watch_banner_4_1764667012294.png';
import watch5 from '../assets/watch_banner_5_1764667034108.png';
import watch6 from '../assets/watch_banner_6_1764667050684.png';
import womensWatch1 from '../assets/womens_watch_1_1764669184082.png';

export default function MostLoved() {
    const [activeTab, setActiveTab] = useState('WOMEN');

    // Men's Collection
    const menWatches = [
        {
            id: 1,
            image: watch2,
            brand: 'VICTORINOX',
            model: 'Men | MAVERICK',
            price: '₹45800',
        },
        {
            id: 2,
            image: watch4,
            brand: 'TAG HEUER',
            model: 'Men | Carrera',
            price: '₹285000',
        },
        {
            id: 3,
            image: watch5,
            brand: 'FREDERIQUE CONSTANT',
            model: 'Men | Skeleton Heart Beat',
            price: '₹165000',
        },
        {
            id: 4,
            image: watch6,
            brand: 'OMEGA',
            model: 'Men | Seamaster Diver',
            price: '₹425000',
        },
        {
            id: 5,
            image: watch1,
            brand: 'LONGINES',
            model: 'Men | Master Collection',
            price: '₹125000',
        },
        {
            id: 6,
            image: watch3,
            brand: 'TISSOT',
            model: 'Men | Gentleman Powermatic',
            price: '₹68500',
        },
    ];

    // Women's Collection
    const womenWatches = [
        {
            id: 1,
            image: womensWatch1,
            brand: 'SWAROVSKI',
            model: 'Women | Crystalline',
            price: '₹40000',
        },
        {
            id: 2,
            image: watch1,
            brand: 'VICTORINOX',
            model: 'Women | MAVERICK',
            price: '₹45800',
        },
        {
            id: 3,
            image: watch3,
            brand: 'MOVADO',
            model: 'Women | Bold',
            price: '₹63755',
        },
        {
            id: 4,
            image: watch4,
            brand: 'TISSOT',
            model: 'Women | Classic Dream',
            price: '₹35500',
        },
        {
            id: 5,
            image: watch6,
            brand: 'RADO',
            model: 'Women | Centrix',
            price: '₹89000',
        },
        {
            id: 6,
            image: watch5,
            brand: 'HAMILTON',
            model: 'Women | Jazzmaster',
            price: '₹72300',
        },
    ];

    const currentWatches = activeTab === 'MEN' ? menWatches : womenWatches;

    return (
        <section className="py-20 px-4 md:px-8 bg-gradient-to-b from-gray-50 to-white relative overflow-hidden">
            {/* Decorative background elements */}
            <div className="absolute inset-0 pointer-events-none">
                <div className="absolute top-0 left-0 w-64 h-64 bg-gradient-to-br from-amber-50 to-transparent opacity-30 rounded-full -translate-x-32 -translate-y-32"></div>
                <div className="absolute bottom-0 right-0 w-96 h-96 bg-gradient-to-tl from-amber-50 to-transparent opacity-20 rounded-full translate-x-48 translate-y-48"></div>
                {/* Fixed SVG pattern - using proper escaping */}
                <div 
                    className="absolute inset-0 opacity-10"
                    style={{
                        backgroundImage: `url("data:image/svg+xml,%3Csvg width='100' height='100' viewBox='0 0 100 100' xmlns='http://www.w3.org/2000/svg'%3E%3Cpath d='M11 18c3.866 0 7-3.134 7-7s-3.134-7-7-7-7 3.134-7 7 3.134 7 7 7zm48 25c3.866 0 7-3.134 7-7s-3.134-7-7-7-7 3.134-7 7 3.134 7 7 7zm-43-7c1.657 0 3-1.343 3-3s-1.343-3-3-3-3 1.343-3 3 1.343 3 3 3zm63 31c1.657 0 3-1.343 3-3s-1.343-3-3-3-3 1.343-3 3 1.343 3 3 3zM34 90c1.657 0 3-1.343 3-3s-1.343-3-3-3-3 1.343-3 3 1.343 3 3 3zm56-76c1.657 0 3-1.343 3-3s-1.343-3-3-3-3 1.343-3 3 1.343 3 3 3zM12 86c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm28-65c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm23-11c2.76 0 5-2.24 5-5s-2.24-5-5-5-5 2.24-5 5 2.24 5 5 5zm-6 60c2.21 0 4-1.79 4-4s-1.79-4-4-4-4 1.79-4 4 1.79 4 4 4zm29 22c2.76 0 5-2.24 5-5s-2.24-5-5-5-5 2.24-5 5 2.24 5 5 5zM32 63c2.76 0 5-2.24 5-5s-2.24-5-5-5-5 2.24-5 5 2.24 5 5 5zm57-13c2.76 0 5-2.24 5-5s-2.24-5-5-5-5 2.24-5 5 2.24 5 5 5zm-9-21c1.105 0 2-.895 2-2s-.895-2-2-2-2 .895-2 2 .895 2 2 2zM60 91c1.105 0 2-.895 2-2s-.895-2-2-2-2 .895-2 2 .895 2 2 2zM35 41c1.105 0 2-.895 2-2s-.895-2-2-2-2 .895-2 2 .895 2 2 2zM12 60c1.105 0 2-.895 2-2s-.895-2-2-2-2 .895-2 2 .895 2 2 2z' fill='%23D4AF37' fill-opacity='0.05' fill-rule='evenodd'/%3E%3C/svg%3E")`
                    }}
                ></div>
            </div>

            <div className="max-w-7xl mx-auto relative z-10">
                {/* Header Section */}
                <div className="flex flex-col items-center mb-16">
                    {/* Subtitle */}
                    <div className="flex items-center justify-center gap-4 mb-4">
                        <div className="w-16 h-px bg-gradient-to-r from-transparent to-amber-600"></div>
                        <span className="text-amber-600 uppercase tracking-widest text-sm font-medium">
                            Curated Collection
                        </span>
                        <div className="w-16 h-px bg-gradient-to-l from-transparent to-amber-600"></div>
                    </div>

                    {/* Main Title */}
                    <h2 className="text-5xl md:text-6xl font-light tracking-tight text-gray-900 text-center mb-8">
                        <span className="font-serif italic">Most</span>{' '}
                        <span className="font-normal">Loved</span>{' '}
                        <span className="font-serif italic">Watches</span>
                    </h2>

                    {/* Description */}
                    <p className="text-gray-600 text-lg max-w-2xl text-center mb-12 leading-relaxed">
                        Discover our exquisite collection of timepieces, where traditional craftsmanship meets contemporary elegance
                    </p>
                </div>

                {/* Tabs Navigation */}
                <div className="flex justify-center items-center gap-12 mb-16 relative">
                    {/* Decorative line */}
                    <div className="absolute top-1/2 left-0 right-0 h-px bg-gradient-to-r from-transparent via-gray-200 to-transparent -translate-y-1/2"></div>
                    
                    <button
                        onClick={() => setActiveTab('MEN')}
                        className={`relative group transition-all duration-300 ${activeTab === 'MEN'
                                ? 'text-gray-900'
                                : 'text-gray-400 hover:text-gray-600'
                            }`}
                    >
                        <div className="flex flex-col items-center">
                            <span className="text-2xl font-light tracking-wide mb-2">
                                For Him
                            </span>
                            <div className={`h-0.5 w-16 transition-all duration-300 ${activeTab === 'MEN'
                                    ? 'bg-gradient-to-r from-amber-500 to-amber-700'
                                    : 'bg-transparent group-hover:bg-gray-300'
                                }`}></div>
                        </div>
                        <div className="absolute -inset-4 rounded-full bg-gradient-to-r from-amber-50 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300 -z-10"></div>
                    </button>

                    <button
                        onClick={() => setActiveTab('WOMEN')}
                        className={`relative group transition-all duration-300 ${activeTab === 'WOMEN'
                                ? 'text-gray-900'
                                : 'text-gray-400 hover:text-gray-600'
                            }`}
                    >
                        <div className="flex flex-col items-center">
                            <span className="text-2xl font-light tracking-wide mb-2">
                                For Her
                            </span>
                            <div className={`h-0.5 w-16 transition-all duration-300 ${activeTab === 'WOMEN'
                                    ? 'bg-gradient-to-r from-rose-400 to-rose-600'
                                    : 'bg-transparent group-hover:bg-gray-300'
                                }`}></div>
                        </div>
                        <div className="absolute -inset-4 rounded-full bg-gradient-to-r from-rose-50 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-300 -z-10"></div>
                    </button>
                </div>

                {/* Watch Grid Section */}
                <div className="relative">
                    {/* Navigation Arrows */}
                    <div className="absolute -top-24 right-0 flex gap-3 z-20">
                        <button className="w-12 h-12 flex items-center justify-center bg-white border border-gray-200 rounded-full shadow-lg hover:shadow-xl hover:scale-105 hover:border-amber-300 transition-all duration-300 group">
                            <ChevronLeftIcon className="w-6 h-6 text-gray-600 group-hover:text-amber-600 transition-colors" />
                        </button>
                        <button className="w-12 h-12 flex items-center justify-center bg-white border border-gray-200 rounded-full shadow-lg hover:shadow-xl hover:scale-105 hover:border-amber-300 transition-all duration-300 group">
                            <ChevronRightIcon className="w-6 h-6 text-gray-600 group-hover:text-amber-600 transition-colors" />
                        </button>
                    </div>

                    {/* Watch Cards Grid */}
                    <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-5 gap-8">
                        {currentWatches.slice(0, 5).map((watch, index) => (
                            <div
                                key={watch.id}
                                className="group relative bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-500 hover:-translate-y-2 border border-gray-100 overflow-hidden"
                            >
                                {/* Ranking Badge */}
                                <div className="absolute top-4 left-4 z-20">
                                    <div className="w-10 h-10 bg-gradient-to-br from-amber-500 to-amber-700 rounded-full flex items-center justify-center shadow-lg">
                                        <span className="text-white font-bold text-sm">#{index + 1}</span>
                                    </div>
                                </div>

                                {/* Watch Image Container */}
                                <div className="relative h-64 overflow-hidden bg-gradient-to-b from-gray-50 to-white">
                                    <img
                                        src={watch.image}
                                        alt={`${watch.brand} ${watch.model}`}
                                        className="w-full h-full object-contain p-6 group-hover:scale-110 transition-transform duration-700"
                                    />
                                    
                                    {/* Hover Overlay */}
                                    <div className="absolute inset-0 bg-gradient-to-t from-black/20 to-transparent opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>
                                </div>

                                {/* Watch Details */}
                                <div className="p-6 pt-4 border-t border-gray-100">
                                    <div className="mb-3">
                                        <h3 className="text-lg font-semibold text-gray-900 mb-1 group-hover:text-amber-700 transition-colors">
                                            {watch.brand}
                                        </h3>
                                        <p className="text-sm text-gray-500 truncate">
                                            {watch.model}
                                        </p>
                                    </div>
                                    
                                    <div className="flex items-center justify-between">
                                        <span className="text-xl font-bold text-gray-900">
                                            {watch.price}
                                        </span>
                                        <button className="text-xs font-medium text-amber-600 hover:text-amber-700 border border-amber-200 hover:border-amber-300 rounded-full px-4 py-1.5 transition-all duration-300 hover:bg-amber-50">
                                            View Details
                                        </button>
                                    </div>
                                </div>

                                {/* Premium Decorative Border */}
                                <div className="absolute inset-0 rounded-2xl border border-amber-200/30 pointer-events-none opacity-0 group-hover:opacity-100 transition-opacity duration-500"></div>
                            </div>
                        ))}
                    </div>
                </div>

                {/* View All Button */}
                <div className="flex justify-center mt-16">
                    <button className="group relative px-8 py-3 bg-transparent border-2 border-amber-600 rounded-full overflow-hidden transition-all duration-300 hover:scale-105">
                        <span className="relative z-10 text-amber-600 font-medium group-hover:text-white transition-colors duration-300">
                            View Complete Collection
                        </span>
                        <div className="absolute inset-0 bg-gradient-to-r from-amber-600 to-amber-700 translate-y-full group-hover:translate-y-0 transition-transform duration-300"></div>
                    </button>
                </div>
            </div>
        </section>
    );
}
